import React from 'react'

namespace Btn {
    export interface Props {
        children?: React.ReactNode
        onMouseEnter?: () => void
        onMouseLeave?: () => void
        [propName: string]: any
        onClick?: () => void
        className?: string
        content?: string
        height: string
        color?: string
        width: string
    }
}

export default function Button(props: Btn.Props) {

    return (
        <div>
            {props.content}
        </div>
    )
}
